import React from 'react'
import favorites from './Assets/favorites.png';
import add from './Assets/add.png';
import './Elements.css'

export const Elements = () => {
    return(
        <>
            <button>Favoritos<img src={favorites} alt="favorites"/></button>
            <button>Agregar<img src={add} alt="add"/></button>
        </>
    )
}
